import { useEffect, useMemo, useState } from "react";
import { Link } from "react-router-dom";
import { Card, CardContent } from "../components/ui/card";
import { Input } from "../components/ui/input";
import { Badge } from "../components/ui/badge";
import { Skeleton } from "../components/ui/skeleton";
import { Separator } from "../components/ui/separator";

type Category = { id: string; label: string; count?: number };
const API_BASE = process.env.REACT_APP_API_BASE || "http://127.0.0.1:8000";

const FALLBACK: Record<string, { label: string; emoji: string; hint: string }> = {
  "cap:text-explain": { label: "Text & Writing", emoji: "‚úçÔ∏è", hint: "chat, writing, editing" },
  "cap:text-summarize": { label: "Summarizers", emoji: "üìù", hint: "TL;DR, notes" },
  "cap:image-generate": { label: "Images & Design", emoji: "üé®", hint: "generators, editors" },
  "cap:video-generate": { label: "Video", emoji: "üé¨", hint: "make & edit videos" },
  "cap:audio-transcribe": { label: "Audio & Speech", emoji: "üéôÔ∏è", hint: "transcribe, voice" },
  "cap:research-web": { label: "Education & Research", emoji: "üîé", hint: "search, sources" },
  "cap:slide-generate": { label: "Slides & Docs", emoji: "üìä", hint: "decks, docs" },
  "cap:automate-workflow": { label: "Automation", emoji: "ü§ñ", hint: "connect apps & flows" },
  "cap:integrations": { label: "Integrations", emoji: "üîå", hint: "APIs, webhooks" },
  "cap:doc-read-pdf": { label: "PDF & Docs", emoji: "üìÑ", hint: "read & analyze PDFs" },
};

export default function Categories() {
  const [loading, setLoading] = useState(true);
  const [cats, setCats] = useState<Category[]>([]);
  const [q, setQ] = useState("");

  useEffect(() => {
    let cancelled = false;
    (async () => {
      try {
        const r = await fetch(`${API_BASE}/catalog/categories`);
        const data = await r.json();
        const arr: Category[] =
          data?.categories ||
          Object.entries(data || {}).map(([id, label]: any) => ({ id, label }));
        if (!cancelled) {
          setCats(arr);
          setLoading(false);
        }
      } catch {
        const arr = Object.keys(FALLBACK).map((k) => ({ id: k, label: FALLBACK[k].label }));
        if (!cancelled) {
          setCats(arr);
          setLoading(false);
        }
      }
    })();
    return () => { cancelled = true; };
  }, []);

  const filtered = useMemo(() => {
    const s = q.trim().toLowerCase();
    if (!s) return cats;
    return cats.filter((c) => c.label.toLowerCase().includes(s) || c.id.toLowerCase().includes(s));
  }, [q, cats]);

  return (
    <main className="mx-auto max-w-7xl px-4 py-8">
      <div className="flex items-end justify-between gap-4 mb-6">
        <div>
          <h1 className="text-3xl md:text-4xl font-bold tracking-tight">Categories</h1>
          <p className="text-muted-foreground mt-1">Browse the full library of AI tools, grouped by purpose.</p>
        </div>
        <Input placeholder="Search categories‚Ä¶" className="max-w-xs" value={q} onChange={(e) => setQ(e.target.value)} />
      </div>

      <Separator className="mb-6" />

      {loading ? (
        <div className="grid sm:grid-cols-2 lg:grid-cols-3 gap-4">
          {Array.from({ length: 9 }).map((_, i) => (<Skeleton key={i} className="h-32 rounded-2xl" />))}
        </div>
      ) : (
        <div className="grid sm:grid-cols-2 lg:grid-cols-3 gap-4">
          {filtered.map((c) => {
            const meta = FALLBACK[c.id] || { emoji: "üß©", hint: "" };
            return (
              <Link key={c.id} to={`/categories/${encodeURIComponent(c.id)}`}>
                <Card className="rounded-2xl hover:shadow-md transition">
                  <CardContent className="py-5">
                    <div className="flex items-center gap-3">
                      <span className="text-2xl">{meta.emoji}</span>
                      <div className="flex-1">
                        <div className="font-semibold">{c.label || c.id}</div>
                        <div className="text-xs text-muted-foreground mt-0.5">{meta.hint}</div>
                      </div>
                    </div>
                  </CardContent>
                </Card>
              </Link>
            );
          })}
        </div>
      )}
    </main>
  );
}
